nsparent\" width=80>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\"><o:p>&nbsp;</o:p></span></p></td></tr>\r\n<tr style=\"mso-yfti-irow: 1\">\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; WIDTH: 415.5pt; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\" width=554 colSpan=2>\r\n<table class=MsoNormalTable style=\"WIDTH: 100%; mso-cellspacing: 0cm; mso-padding-alt: 0cm 0cm 0cm 0cm\" cellSpacing=0 cellPadding=0 width=\"100%\" border=0>\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes\">\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\">\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\"><o:p>&nbsp;</o:p></span></p></td></tr>\r\n<tr style=\"mso-yfti-irow: 1; mso-yfti-lastrow: yes\">\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\">\r\n<table class=MsoNormalTable style=\"WIDTH: 100%; mso-cellspacing: 0cm; mso-padding-alt: 0cm 0cm 0cm 0cm\" cellSpacing=0 cellPadding=0 width=\"100%\" border=0>\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes; mso-yfti-lastrow: yes\">\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\">\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">波状挡边输送带被广泛应用于港口、冶金、矿山、电力、煤炭、铸造、建材、粮食、化工等领域物料输送。<span lang=EN-US><br /></span>能使各种散装物料以<span lang=EN-US>0-90</span>度作任意倾角连续输送、具有输送倾角大、使用范围广、占地面积小。无转运点、减<span lang=EN-US><br /></span>少土建投资、维护费用低、输送量大等特点，解决了普通输送带或花纹输送带所不能达到的输送角度。波状挡<span lang=EN-US><br /></span>边输送带可根据要求设计成一套完整输送系统，避免了间断输送和复杂输送的提升系统。<span lang=EN-US><br /></span>波状挡边输送带可沿水平、倾斜、垂直和变角方向输送各种散装物料，从煤、矿石、沙子到化肥和粮食等。<span lang=EN-US><br /></span>物料粒度不限，可从很小的粒度到<?xml:namespace prefix = st1 ns = \"urn:schemas-microsoft-com:office:smarttags\" /><st1:chmetcnv w:st=\"on\" UnitName=\"mm\" Sourceva lue=\"400\" HasSpace=\"False\" Negative=\"False\" NumberType=\"1\" TCSC=\"0\"><span lang=EN-US>400mm</span></st1:chmetcnv>的大粒度，输送量可从<span lang=EN-US>1</span>立方米<span lang=EN-US>/</span>小时到<span lang=EN-US>6000</span>立方米<span lang=EN-US>/</span>小时<span lang=EN-US><o:p></o:p></span></span></p></td></tr></tbody></table>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\"><o:p></o:p></span></p></td></tr></tbody></table>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\"><o:p></o:p></span></p></td>\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; WIDTH: 60pt; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\" width=80>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">&nbsp;<o:p></o:p></span></p></td></tr>\r\n<tr style=\"mso-yfti-irow: 2\">\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; WIDTH: 241.5pt; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\" width=322>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><b><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">基带的要求<span lang=EN-US><br /></span></span></b><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">波状挡边输送带要求具有一定的抗拉强度和耐磨性。其中对留有空边的波状挡<span lang=EN-US><br /></span>边输送带，为了适应角度改向的要求，胶带的纵向要求有柔软性，横向则要求一定的刚性。公司生产的波状挡边输送带采用特殊结构的横向刚性基带，解决<span lang=EN-US><br /></span>了大规格输送带在回程过程塌带现象。<span lang=EN-US><br /></span>基带的构造<span lang=EN-US><br /></span>基带是由上覆盖胶、下覆盖胶、带芯和横向刚性层四部分组成。上覆盖胶厚度<span lang=EN-US><br /></span>一般为<span lang=EN-US>3-6mm</span>； 下覆盖胶厚度一般为<span lang=EN-US>1.5-4.5mm</span>。带芯材料承受拉力，其材料可以是棉帆布（<span lang=EN-US>CC</span>）、尼龙帆布（<span lang=EN-US>NN</span>）、聚酯帆布（<span lang=EN-US>EP</span>）或钢丝绳（<span lang=EN-US>ST</span>）。为了增加基带的横向刚性，在芯体加入特殊加强层，称横向刚性层。基带的宽度规格，与普通胶带相同，符合<span lang=EN-US>GB/T7984-2001</span>的标准规定。<span lang=EN-US><o:p></o:p></span></span></p></td>\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; WIDTH: 232.5pt; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\" vAlign=top width=310 colSpan=2>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\"><o:p>&nbsp;</o:p></span></p></td></tr>\r\n<tr style=\"mso-yfti-irow: 3\">\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; WIDTH: 474pt; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\" width=632 colSpan=3>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\"><o:p>&nbsp;</o:p></span></p></td></tr>\r\n<tr style=\"mso-yfti-irow: 4\">\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; WIDTH: 474pt; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\" width=632 colSpan=3>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">公司根据波状挡边带的使用原理对波状挡边的制造工艺进行了改革创新，在波状挡边内部贴置防撕裂帆布层，以增强波状挡边<span lang=EN-US><br /></span>的耐撕裂性、耐曲挠性，避免因拉伸压缩而导致挡边被撕裂，增加了挡边的使用寿命。该工艺已申请国家专利（专利号为<span lang=EN-US>98222267.X.</span>）<span lang=EN-US><br />S</span>形波状挡边按承载能力可分为轻型（<span lang=EN-US>N</span>） 、 中型（<span lang=EN-US>S</span>）和重型（<span lang=EN-US>ES</span>） 。<span lang=EN-US><o:p></o:p></span></span></p></td></tr>\r\n<tr style=\"mso-yfti-irow: 5\">\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\" colSpan=3>\r\n<table class=MsoNormalTable style=\"WIDTH: 100%; mso-cellspacing: 0cm; mso-padding-alt: 0cm 0cm 0cm 0cm\" cellSpacing=0 cellPadding=0 width=\"100%\" border=0>\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes; mso-yfti-lastrow: yes\">\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; WIDTH: 51%; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\" width=\"51%\">\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">公司生产的横隔板采用纤维复合材料制作而成，挺性大、增强耐冲击性，避免了隔板因受力而发生形变。<span lang=EN-US><br /></span>在磨损较重的情况下，为维修方便，横隔板可做成锒嵌式，如<span lang=EN-US>TS</span>和<span lang=EN-US>TCS</span>。<span lang=EN-US><br /></span>输送机倾斜角度小于<span lang=EN-US>40</span>度时，横隔板用<span lang=EN-US>T</span>型或<span lang=EN-US>TS</span>型；倾斜角度大于<span lang=EN-US>40</span>度时，横隔板用<span lang=EN-US>C</span>型、<span lang=EN-US>TC</span>型或<span lang=EN-US>TCS</span>型。<span lang=EN-US><br /></span>布置横隔板间距时，应考虑与波状挡边的波峰相对应。以防止物料从二者缝中漏下和卸料时造成积料死角。<span lang=EN-US><br /></span>我公司生产的波状挡边输送带，挡边、横隔板与基带的粘接采用二次低温热硫化粘接，粘接强度高，粘接牢固、平整，不掉板，不脱落。<span lang=EN-US><o:p></o:p></span></span></p></td>\r\n<td style=\"BORDER-RIGHT: #ece9d8; PADDING-RIGHT: 0cm; BORDER-TOP: #ece9d8; PADDING-LEFT: 0cm; PADDING-BOTTOM: 0cm; BORDER-LEFT: #ece9d8; WIDTH: 49%; PADDING-TOP: 0cm; BORDER-BOTTOM: #ece9d8; BACKGROUND-COLOR: transparent\" vAlign=top width=\"49%\">\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\"><o:p>&nbsp;</o:p></span></p></td></tr></tbody></table>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">&nbsp;<o:p></o:p></span></p>\r\n<table class=MsoNormalTable style=\"WIDTH: 100%; mso-cellspacing: 0cm; mso-padding-alt: 0cm 0cm 0cm 0cm\" cellSpacing=0 cellPadding=0