INSERT INTO `p8_business_content_1` VALUES ('14','1273','1000031','<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt\"><span style=\"FONT-SIZE: 9pt; COLOR: #434343; FONT-FAMILY: 宋体; mso-bidi-font-family: 宋体; mso-font-kerning: 0pt\">山东</span><span style=\"FONT-SIZE: 9pt; COLOR: red; FONT-FAMILY: 宋体; mso-bidi-font-family: 宋体; mso-font-kerning: 0pt\">淄博绿象橡胶厂</span><span style=\"FONT-SIZE: 9pt; COLOR: #434343; FONT-FAMILY: 宋体; mso-bidi-font-family: 宋体; mso-font-kerning: 0pt\">是淄博市橡胶专业生产厂家和山东省大户工业企业之一，主要产品包括普通<span lang=EN-US>V</span>带、窄<span lang=EN-US>V</span>带、联组带、六角带、输送带、平机带、橡胶杂件等。企业成立于<span lang=EN-US>1993</span>年。厂区占地面积一万多平方米，建筑面积五千平方米，拥有职工三百余人，具备国内先进的生产检测设备。企业产品通过美国<span lang=EN-US>DOT</span>和欧洲<span lang=EN-US>ECE</span>以及<span lang=EN-US>CCC</span>强制认证，质量管理体系通过<span lang=EN-US>TSQ9000</span>、<span lang=EN-US>VDA6.1</span>、<span lang=EN-US>GB/T19001.ISO9001</span>和<span lang=EN-US>TS16949</span>体系认证。<span lang=EN-US>“</span>日久<span lang=EN-US>”</span>商标被认定为山东省著名商标<span lang=EN-US>.</span>公司销售网络覆盖全国各地，远销欧美、中东、东南亚、非洲、中南美洲等<span lang=EN-US>120</span>多个国家和地区。企业先后获得<span lang=EN-US>“</span>全国重合同守信用单位<span lang=EN-US>”</span>、<span lang=EN-US>“</span>全国行业质量服务诚信示范企业<span lang=EN-US>”</span>、<span lang=EN-US>“</span>全国行业质量示范企业<span lang=EN-US>”</span>、<span lang=EN-US>“</span>中国产品质量信得过企业<span lang=EN-US>”“</span>守合同重信用企业<span lang=EN-US>” <br /><br /></span></span></p>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; WORD-BREAK: break-all; LINE-HEIGHT: 150%; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span style=\"FONT-SIZE: 9pt; COLOR: blue; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-bidi-font-family: 宋体; mso-font-kerning: 0pt\">三角带 ：<span lang=EN-US>Z A B C D E </span>型<span lang=EN-US><br /></span>窄<span lang=EN-US>V</span>带 ：<span lang=EN-US>SPZ SPA SPB SPC 3V 9N 5V 15N 8V 25N<br /></span>联组窄<span lang=EN-US>V</span>带<span lang=EN-US> : 3V 9J&nbsp; 5V 15J 8V 25J SPA SPB SPC <br /></span>联组普通<span lang=EN-US>V</span>带：<span lang=EN-US>A B C D <span style=