INSERT INTO `p8_business_content_1` VALUES ('16','1273','1000031','<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; WORD-BREAK: break-all; LINE-HEIGHT: 150%; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">联组<span lang=EN-US>V </span>带是由相同的普通<span lang=EN-US>V</span>带或窄<span lang=EN-US>V</span>带的顶面联为一体而形成的<span lang=EN-US>V</span>带组。联组<span lang=EN-US>V</span>带连接层可使单根<span lang=EN-US>V</span>带的非一致振动形成互消而减至最低限度，并且通过联组赋予各根以横向刚性和稳定性，从而消除各单根的振动现象，带间水平方向稳定性好，运转中不易掉带和不互相干扰，适合于大功率传动。<span lang=EN-US><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></span></span></p>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; WORD-BREAK: break-all; LINE-HEIGHT: 150%; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">&nbsp;<o:p></o:p></span></p>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; WORD-BREAK: break-all; LINE-HEIGHT: 150%; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">&nbsp;<o:p></o:p></span></p>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; WORD-BREAK: break-all; LINE-HEIGHT: 150%; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">&nbsp;&nbsp;</span><b><span style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">石油机械（抽油机等）用橡胶联组窄<span lang=EN-US>V</span>带</span></b><span lang=EN-US style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-f