INSERT INTO `p8_business_content_1` VALUES ('38','1231','1000032','<p>手持式铝箔封口机\\铝箔袋封口机\\感应封口机<br />电磁感应封口机\\感应封口机\\铝箔封口机<br /></p>\r\n<p>设备名称：DCGY-F500型手持式铝箔封口机<br />产品介绍<br />该手持式铝箔封口机用于医药、化工、食品、饮料、化妆品、润滑油等行业的塑料玻璃等非金属包装容器的铝箔封口作业。<br />・手持式电磁感应铝箔封口机是采用电磁场感应加热原理，是利用高频电流通过电感线圈产生磁场，当磁力线穿过封口铝箔材料时，瞬间产生大量小涡流，致使铝箔自行高速发热，熔化复合在铝箔上的溶胶，从而粘贴在承封物的封口上，达到迅速封口的目的。<br />封口容器的材质可以是聚乙（PE）、聚丙烯（PP）、聚酯（PET）、聚苯乙烯（PS）、ABS以及玻璃等，不能用于金属瓶体及瓶盖。 </p>\r\n<p>技术参数<br />输入电源：AC220V/50Hz~60Hz<br />输入功率：1200W<br />封口直径：Φ20-100毫米<br />封口方式：手持式<br />容器高度：无限制<br />外型尺寸：260×345×165mm<br />重量：3.5kg</p>\r\n<p>联系人：黄森 电话：0371-69079538 手机：15038057568<br />我厂主要产品有：全自动液体灌装机、全自动膏体灌装机、高精度灌装机、食用油灌装机、日化灌装机、柱塞式灌装机、半自动气动灌装机、单头灌装机、双头灌装机、半自动灌装生产线、全自动灌装生产线、粉剂包装机、颗粒包装机、提升机、喷码机、色带打码机、油墨打码机、自动打码机、塑料封口机、铝箔封口机、全自动旋盖机、金属防盗盖封盖机、半自动打包机、全自动打包机、气动打包机、钢带打包机、贴标机、定做各种热收缩包装机、折纸机等。</p>\r\n<p>河南豫盛包装机械携手河南及全国企业共创辉煌！<br /><a href=\"http://www.ysbzjx.cn/\">http://www.ysbzjx.cn/</a> <a href=\"http://www.ysbzjx.cn/\">灌装机械|包装机械</a><br /><a href=\"http://www.ysjxpack.cn/\">http://www.ysjxpack.cn/</a> <a href=\"http://www.ysjxpack.cn/\">包装设备|灌装设备</a><br /><a href=\"http://www.yushengpack.cn/\">http://www.yushengpack.cn/</a> <a href=\"http://www.yushengpack.cn/\">河南包装机|河南灌装机</a><br /><a href=\"http://www.ysbzjx.com/\">http://www.ysbzjx.com/</a> <a href=\"http://www.ysbzjx.com/\">灌装机价格|灌装机厂家</a><br /><a href=\"http://www.packysjx.com/\">http://www.packysjx.com/</a> <a href=\"http://www.packysjx.com/\">灌装机设备|包装机厂家</a><br /><a href=\"http://www.packysjx.com/Product.html\">http://www.packysjx.com/Product.html</a> <a href=\"http://www.packysjx.com/Product.html\">灌装机|河南打包机</a><br /><a href=\"http://www.ysbzjx.cn/product.html\">http://www.ysbzjx.cn/product.html</a> <a href=\"http://www.ysbzjx.cn/product.html\">包装机|河南灌装机</a><br /><a href=\"http://www.ysbzjx.com/product.html\">http://www.ysbzjx.com/product.html</a> <a href=\"http://www.ysbzjx.com/product.html\">封口机价格|灌装机价格</a><br /><a href=\"http://www.packysjx.cn/gzj-jl.html\">http://www.packysjx.cn/gzj